var posDailyAveData = function (year, month) {
    var arr = new Array(), retValue = new Array(), daysInMonth = getDaysInMonth(year, month);
    for (var i = 0; i < posList.length ; i++) {
        var ar = posDataD.filter(function (v) {
            return (v["点位编码"] == posList[i]["编码"] && v["Month"] == month);
        });
        arr.push(ar);
    }
    for (var i = 0; i < daysInMonth; i++) {
        var total = 0, validPos = 0;
        for (var j = 0; j < arr.length; j++) {
            if (typeof arr[j][i] != "undefined" && typeof arr[j][i]["监测值"] != "undefined") {
                total += parseFloat(arr[j][i]["监测值"]);
                ++validPos;
            }
        }
        retValue.push({ day: (i + 1), value: (validPos == 0 ? null : total / validPos) });
    }
    return retValue;
}


var industryMonthData = function (year, month) {
    var industryTotalArr = [], monthString = month.toString(), allTotal = 0, percent = 0;
    industryType.forEach(function (value, index, array) {
        var total = 0;
        companyMonthData.filter(function (v) {
            return v["行业"] == value;
        }).forEach(function (val, ind, arr) {
            val["月数据"].forEach(function (v, i, ar) {
                if (v["月份"] == monthString) {
                    total += parseFloat(v["月平均排放量"]);
                }
            });
        });
        allTotal += total;
        industryTotalArr.push({ "行业": value, "月排放量": total });
    });
    industryTotalArr.sort(function (a, b) {
        return a["月排放量"] >= b["月排放量"] ? -1 : 1;
    }).forEach(function (value, index, array) {
        if (index != array.length - 1) {
            var per = value["月排放量"] / allTotal;
            percent += per;
            value["月排放比例"] = per;
        } else {
            value["月排放比例"] = 1 - percent;
        }
    });
    return industryTotalArr;
}

